import React, {Fragment} from 'react';
import NavigationItem from "./NavigationItem/NavigationItem";
import classes from './NavigationItems.module.css'

const NavigationItems = (props) => {
    return (
        <ul className={classes.NavigationItems}>
            <NavigationItem link = {'/training'} onClick={props.clicked}>Train words</NavigationItem>
            <NavigationItem link = {'/words'} onClick={props.clicked}>My Words</NavigationItem>
            <NavigationItem link = {'/edit'} onClick={props.clicked}>Add / Edit Words</NavigationItem>
        </ul>
    );
};

export default NavigationItems;
